import React from "react";
import ReactDOM from "react-dom";
import List from "./components/List.jsx";
import axios from "axios";
import Create from "./components/Create.jsx";
import Login from "./components/Login.jsx";
// import Admin from "./components/Admin.jsx";
// import TA from "./components/TA.jsx";


export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      view: "login",
      appointments: [],
      nomTA:"",
      total:0,
      nomAdmin:"",
      
      
    };
    this.changeView = this.changeView.bind(this);
    this.getNomTA=this.getNomTA.bind(this);
    this.getNomAdmin=this.getNomAdmin.bind(this);
  }

  componentDidMount() {
    
    axios.get("/api/bcc").then((result) => {
      console.log("I am front end index");
      console.log(result.data);
      
      this.setState({ appointments: result.data , total:result.data.length});
    });

    axios.get("/api/bcc/Admin").then((result) => {
      console.log("I am front end index");
      console.log(result.data);
      
      // this.setState({ appointments: result.data , total:result.data.length});
    });
  }
  changeView(option) {
    this.setState({
      view: option,
    });
    this.componentDidMount();
  }
  getNomTA(nom){
    this.setState({nomTA:nom});
  }
  getNomAdmin(nom){
    this.setState({nomAdmin:nom});
  }
  renderView() {
    const { view } = this.state;
     if (view === "list") {
      return <List items={this.state.appointments} nomTA={this.state.nomTA} total={this.state.total}/>;
    } else if(view==="login"){
      return <Login changeView={this.changeView} getNomTAAndId={this.getNomTA}/>;
    // } else if(view==="admin"){
    //   return <Admin changeView={this.changeView} getNomAdmin={this.getNomAdmin} />;
    } 
    else if(view==="create"){
      return <Create changeView={this.changeView}/>;
    }  else if(view==="ta"){
      return <TA changeView={this.changeView}/>;
    }  

    else{
      return <Create changeView={this.changeView}/>;
    }
  }

  render() {
    <h1>hello</h1>
    {
      
      console.log("i am in render",this.state.appointments);
    }
    return (
      <div>
        <div>
          <img className="logo" src="data:image/png;base64,"/>
        </div>
        <nav>
          <div className="navbar">
            <span className="logo" onClick={() => this.changeView("list")}>
             
            </span>
            <span className="nav" onClick={() => this.changeView("list")}>
              All Appointments
            </span>

            <span className="nav" onClick={() => this.changeView("create")}>
              Add Appointment
            </span>
            {/* <span className="nav" onClick={() => this.changeView("admin")}>
             Admin
             </span> */}
             {/* <span className="nav" onClick={() => this.changeView("create")}>
             TA
             </span> */}
          </div>   
        </nav>

        <div className="main">{this.renderView()}</div>
      </div>
    );
  }
  
};